  \"spatial\",\n\t\t\"value\": \"{\"type\": \"Polygon\", \"coordinates\": [[[-128.07002717,
  22.67774911], [-65.25698378, 22.67774911], [-65.25698378, 48.26194027], [-128.07002717,
  48.26194027], [-128.07002717, 22.67774911]]]}\"\n\t},\n\t{\n\t\t\"key\": \"progress\",\n\t\t\"value\":
  \"completed\"\n\t},\n\t{\n\t\t\"key\": \"access_constraints\",\n\t\t\"value\": \"[\"Use
  Constraints: NITROGEN-FERTILIZER SALES DATA Estimates of nitrogen-fertilizer sales
  by county were generated by the U.S. Environmental Protection Agency (1990) and
  by Jerald Fletcher (West Virginia University, written commun., 1992) by using the
  following procedure: (1) compiling annual State fertilizer-sales data reported as
  tonnages to the National Fertilizer and Environmental Research Center of the TVA;
  (2) calculating the ratio of expenditures for commercial fertilizers by county to
  expenditures for commercial fertilizers by States from the 1987 Census of Agriculture
  (U.S. Department of Commerce, 1989a); and (3) computing annual county-level nitrogen-fertilizer
  sales, in tons, by multiplying estimates of annual States sales by the ratio of
  county expenditures to States expenditures. In some counties no fertilizer sales
  were reported, but some fertiliz use was reported in the Census Data. Although fertilizer
  expenditures estimates (in $1,000) represent the 1987 growing year, the nitrogen-fertilizer
  sales estimates (tons) generally reflect 1985 amounts. Estimates of nitrogen-fertilizer
  sales by county were constructed fro a combination of data reported to State regulatory
  agencies and from data in the 1987 Census of Agriculture. Fertilizer-sales data
  submitte annually to State regulatory agencies by fertilizer dealers reflect total
  sales without regard to the land use for which it was bought, or the State (or county)
  in which the fertilizer was actually used. In the Census of Agriculture sampling
  and statistics were used to account for nonresponding farm operations (U.S. Department
  of Commerce, 1989b) Thus, the information that describes county-level fertilizer
  sales is subject to sampling variability as well as reporting and coverage errors.
  Census disclosure rules also prevent the publication of information that would reveal
  the operation of individual farms. COUNTY BOUNDARIES The original files for this
  map were provided in 15 sections. Boundarie near the edges of sections have been
  adjusted in edgematching. Polygons that extend into the water (an ocean or the Great
  Lakes) shoul be considered arbitrary.\", \"Access Constraints: (describe any restrictions
